import './App.css';
import { Provider } from 'react-redux';
import store from './redux/store';
import TopHeader from './pages/header/Header';
import MainComponent from './pages/hero/MainComponent';

function App() {
  return (
    <Provider store={store}>
      <div>
        <TopHeader/>
        <MainComponent/>
      </div>
    </Provider>
  );
}

export default App;
